CREATE TABLE `defunt_archive` (
  `codeGestionConcession` varchar(10) NOT NULL COMMENT 'Code de gestion de la concession',
  `numeroOrdre` decimal(2,0) NOT NULL DEFAULT '0' COMMENT 'numero du défunt dans la concession',
  `nomPrenom` varchar(200) NOT NULL COMMENT 'Nom et prenom du défunt',
  `nomJF` varchar(200) NOT NULL DEFAULT '' COMMENT 'Nom de jeune fille de la défunte',
  `dateNaissance` date DEFAULT NULL COMMENT 'date de naissance du défunt',
  `lieuNaissance` varchar(200) DEFAULT NULL COMMENT 'lieu de naissance du défunt',
  `dateDeces` date NOT NULL DEFAULT '0001-01-01' COMMENT 'date de déces du défunt',
  `lieuDeces` varchar(200) DEFAULT NULL COMMENT 'lieu de déces du défunt',
  `dateHinumation` date DEFAULT '0001-01-01' COMMENT 'dare d''hinumation',
  `dateExumation` date DEFAULT '0001-01-01' COMMENT 'date d''exumation',
  `dateReduction` date DEFAULT '0001-01-01' COMMENT 'date de reduction ',
  `envellopeFuneraire` varchar(200) DEFAULT NULL COMMENT 'Envellope dans lequel le défunt a été hinumé',
  `entrepriseFuneraire` varchar(200) DEFAULT NULL COMMENT 'Entreprise responsable de l''inumtion',
  `marbrier` varchar(200) DEFAULT NULL COMMENT 'Marbrier qui a fait la concession',
  `comentaire` text COMMENT 'Commentaire sur la concession',
  `oppositionCremation` varchar(25) NOT NULL DEFAULT 'Non renseignÃ©'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
